float *TDNNClassifier::Predict(Data data) {
  static float prediction[1];
  float sum = 0.0f;

  for (int i = 0; i < 1; i++) {
    prediction[i] = 0.0f;
  }

  for (int i = 0; i < 8; i++) {
    data.value[i] = (data.value[i] - X1_STEP1.xoffset[i]) * X1_STEP1.gain[i] + X1_STEP1.ymin;
  }

  _num++;
  if (_num > 100) {

    for (int n = 0; n < 20; n++) {
      sum = 0.0f;
      for (int i = 100-1; i >= 0; i--) {
        Data temp = _input.get(i);
        for (int j = 0; j < 8; j++) {
          sum += temp.value[j] * IW1_1[n][((100-1)-i)*8+j];
        }
      }
      sum += B1net[n];
      sum = 2 / (1 + expf(-2*sum)) - 1;

      for (int i = 0; i < 1; i++) {
        prediction[i] += sum * LW2_1[i][n];
      }
    }
    for (int i = 0; i < 1; i++) {
      prediction[i] += B2net[i];
      prediction[i] = (prediction[i] - Y1_STEP1.ymin) / Y1_STEP1.gain[i] + Y1_STEP1.xoffset[i];
    }
  }

  _input.add(data);

  return prediction;
}
